import React from "react";

function Post() {
  return (
    <Card>
      <CardActionArea>
        <CardMedia
          image="https://images.pexels.com/photos/12977998/pexels-photo-12977998.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1"
          title="My Post"
        />
        <CardContent></CardContent>
      </CardActionArea>
    </Card>
  );
}

export default Post;
